#[doc = " GFileSetContentsFlags:"]
#[doc = " @G_FILE_SET_CONTENTS_NONE: No guarantees about file consistency or durability."]
#[doc = "    The most dangerous setting, which is slightly faster than other settings."]
#[doc = " @G_FILE_SET_CONTENTS_CONSISTENT: Guarantee file consistency: after a crash,"]
#[doc = "    either the old version of the file or the new version of the file will be"]
#[doc = "    available, but not a mixture. On Unix systems this equates to an `fsync()`"]
#[doc = "    on the file and use of an atomic `rename()` of the new version of the file"]
#[doc = "    over the old."]
#[doc = " @G_FILE_SET_CONTENTS_DURABLE: Guarantee file durability: after a crash, the"]
#[doc = "    new version of the file will be available. On Unix systems this equates to"]
#[doc = "    an `fsync()` on the file (if %G_FILE_SET_CONTENTS_CONSISTENT is unset), or"]
#[doc = "    the effects of %G_FILE_SET_CONTENTS_CONSISTENT plus an `fsync()` on the"]
#[doc = "    directory containing the file after calling `rename()`."]
#[doc = " @G_FILE_SET_CONTENTS_ONLY_EXISTING: Only apply consistency and durability"]
#[doc = "    guarantees if the file already exists. This may speed up file operations"]
#[doc = "    if the file doesnt currently exist, but may result in a corrupted version"]
#[doc = "    of the new file if the system crashes while writing it."]
#[doc = ""]
